import React from 'react'

class Floor extends React.Component {

    render() {
        return (
            <form id='floor'>
                <ul>
                    {this.props.allFloors.map(x => (
                    <li key={x}>
                        <input 
                                type='radio' 
                                name='floor' 
                                onChange={this.props.handleChangeFloor}
                                style={
                                    x === this.props.floor ? 
                                    {color: 'blue'} : {color: 'brown'}
                                }
                        />
                        <label htmlFor={x}>{x === this.props.floor ? x : 'x'}</label>
                    </li>))}
                </ul>
            </form>)
    }
}

export default Floor
